def analyze_group(group: str) -> Tuple[str, bool, int]:
    stack = []
    max_depth = 0
    pairs = {'(': ')', '[': ']', '{': '}', '<': '>'}

    for char in group:
        if char in pairs:  # Opening bracket
            stack.append(char)
            max_depth = max(max_depth, len(stack))
        elif char in pairs.values():  # Closing bracket
            if not stack:
                return (group, False, max_depth)
            expected_opener = None
            for opener, closer in pairs.items():
                if closer == char:
                    expected_opener = opener
                    break
            if stack[-1] != expected_opener:
                return (group, False, max_depth)
            stack.pop()

    is_balanced = len(stack) == 0
    return (group, is_balanced, max_depth)

