def x_or_y(n, x, y):
    """A simple program which should return the value of x if n is 
    a prime number and should return the value of y otherwise.
    Additionally, if n is a perfect square, return x + y.
    If n is both prime and a perfect square (only possible for n=1),
    return x * y.

    Examples:
    for x_or_y(7, 34, 12) == 34 (7 is prime)
    for x_or_y(15, 8, 5) == 5 (15 is not prime)
    for x_or_y(4, 10, 20) == 30 (4 is a perfect square)
    for x_or_y(1, 5, 3) == 15 (1 is considered both, so return 5*3)
    """
    # The rules have an order of precedence. The most specific rules are checked first.

    # Rule for n=1: "both prime and a perfect square"
    if n == 1:
        return x * y

    # Rule for perfect squares (takes precedence over prime for n > 1)
    # We assume n is a non-negative integer.
    if n >= 0 and int(n**0.5) ** 2 == n:
        return x + y

    # Rule for prime numbers
    is_p = n > 1
    if is_p:
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                is_p = False
                break

    if is_p:
        return x

    # Default "otherwise" rule
    return y
